import {ComponentFactory} from '@angular/core';
import {async, ComponentFixture, fakeAsync, TestBed, tick} from '@angular/core/testing';
import {DonationsProgramsOverviewComponent} from './donationsPrograms-overview.component';
import {RouterTestingModule} from '@angular/router/testing';
import {BrowserAnimationsModule} from '@angular/platform-browser/animations';
import {FormBuilder, ReactiveFormsModule} from '@angular/forms';
import {ActivatedRoute, Router} from '@angular/router';
import {of} from 'rxjs';
import {ResourcesService} from '../../../../services/resources.service';
import {NgbModal} from '@ng-bootstrap/ng-bootstrap';
import {HttpHeaders} from '@angular/common/http';
import {ToastrService} from 'ngx-toastr';
import {SharedComponentsModule} from '../../../shared/shared.module';

const routerSpy = jasmine.createSpyObj('Router', ['navigate']);
const resourcesServiceSpy = jasmine.createSpyObj('ResourcesService',
  ['deleteDonationProgram', 'getDonationPrograms']);
const modalServiceSpy = jasmine.createSpyObj('NgbModal', ['open']);
const toastrServicespy = jasmine.createSpyObj('ToastrService', ['error', 'success']);

const header = new HttpHeaders({
  'x-pagination' : JSON.stringify({totalPages: 9})
});
const donationPrograms = { body: [

    {
      DonationProgramId: 14,
      DonationProgramName: 'Donation 3',
      Description: 'This is a banner that has the purpose of a substitute for a donation.',
      ImageRef: 'data:image/png;base64,',
      StartDate: '2019-07-10T00:00:00',
      EndDate: '2021-08-22T00:00:00',
      Total: 242372
    },
    {
      DonationProgramId: 16,
      DonationProgramName: 'Donation 4',
      Description: 'This is a donation',
      ImageRef: 'data:image/jpeg;base64,',
      StartDate: '2019-11-15T00:00:00',
      EndDate: '2020-12-26T00:00:00',
      Total: 2012122
    },
    {
      DonationProgramId: 17,
      DonationProgramName: 'Donation 5',
      Description: 'For all the people most affected by the current crisis from the bottom of our hearts.',
      ImageRef: 'data:image/png;base64,',
      StartDate: '2020-04-17T00:00:00',
      EndDate: '2020-07-26T00:00:00',
      Total: 65467757
    }, {
      DonationProgramId: 18,
      DonationProgramName: 'Donation 6',
      Description: 'thEEE dESCRIPTION',
      ImageRef: 'data:image/png;base64,',
      StartDate: '2020-04-01T00:00:00',
      EndDate: '2020-05-31T00:00:00',
      Total: 10060
    }
], headers: header};
const route = ({data: of({ donationPrograms})} as any);

describe('Donation Programs Overview Component Integrated Test', () => {
  let fixture: ComponentFixture<DonationsProgramsOverviewComponent>;

  function advance(f: ComponentFixture<any>) {
    tick();
    f.detectChanges();
  }

  let geDonationProgramsSpy;
  let deleteDonationProgramSpy;
  beforeEach(async(() => {
    TestBed.configureTestingModule({
      imports: [
        RouterTestingModule,
        BrowserAnimationsModule,
        ReactiveFormsModule,
        SharedComponentsModule
      ],
      providers: [
        {provide: ResourcesService, useValue: resourcesServiceSpy},
        FormBuilder,
        {provide: Router, useValue: routerSpy },
        {provide: NgbModal, useValue: modalServiceSpy},
        {provide: ActivatedRoute, useValue: route},
        {provide: ToastrService, useValue: toastrServicespy}
      ],
      declarations: [ DonationsProgramsOverviewComponent ]
    }).compileComponents();

    fixture = TestBed.createComponent(DonationsProgramsOverviewComponent);
    fixture.detectChanges();
    geDonationProgramsSpy = resourcesServiceSpy.getDonationPrograms.and.returnValue(of(donationPrograms));
    deleteDonationProgramSpy = resourcesServiceSpy.deleteDonationProgram.and.returnValue(of(true));
  }));
  it('should have loaded data form activated route before initialization ', fakeAsync( () => {
    fixture.detectChanges();
    expect(fixture.componentInstance.donationPrograms).toEqual(donationPrograms.body);
  }));

  it('modalService open() should be called when edit ', fakeAsync( () => {
    const button = fixture.debugElement.nativeElement.querySelector('#edit17');
    button.click();
    fixture.detectChanges();
    expect(modalServiceSpy.open).toHaveBeenCalled();
  }));

  it('modalService open() should be called when add ', fakeAsync( () => {
    const button = fixture.debugElement.nativeElement.querySelector('#add');
    button.click();
    fixture.detectChanges();
    expect(modalServiceSpy.open).toHaveBeenCalled();
  }));

  it('resourceService deleteDonationProgram(donationProgramId) should be called when delete ', fakeAsync( () => {
    const button = fixture.debugElement.nativeElement.querySelector('#delete17');
    button.click();
    fixture.detectChanges();
    advance(fixture);
    expect(resourcesServiceSpy.deleteDonationProgram).toHaveBeenCalled();
  }));
});
